import React, { useEffect, useState } from 'react';
 import './index.css';

const App = () => {

   const [num, setNum] = useState(1);

   useEffect(() => {
      // alert("I am cliked");
      document.title=`you clicked me ${num} times`;
   });
   
   return (
      <>
 
      <button 
       onClick={ () => {
          setNum(num+1);
       }}
       > click me {num}</button>
   </>
   );
};

export default App;
